        public static List<BookModel> GetBooks(string search = "")
        {
            var result = new List<BookModel>();

            if (!string.IsNullOrWhiteSpace(search))
            {
                result = MockBook.Where(x =>
                    x.ISBN.Contains(search) ||
                    x.Title.Contains(search) ||
                    x.Publisher.Contains(search) ||
                    x.Desc.Contains(search) ||
                    x.Author.Contains(search)
               ).OrderBy(x => x.Id).ToList();
            }
            else
            {
                result = MockBook.OrderBy(x => x.Id).ToList();
            }

            return result;
        }

        public static BookModel GetBookById(int id)
        {
            return MockBook.FirstOrDefault(x => x.Id == id);
        }

        public static bool CreateBook(BookModel book)
        {
            try
            {
                MockBook.Add(book);
                return true;
            }
            catch (Exception ex)
            {
                return false;
                //throw ex;  TODO: Write Log
            }
        }

        public static bool UpdateBook(BookModel book)
        {
            try
            {
                var _book = MockBook.First(x => x.Id == book.Id);
                _book.ISBN = book.ISBN;
                _book.Title = book.Title;
                _book.Publisher = book.Publisher;
                _book.Desc = book.Desc;
                _book.Author = book.Author;
                return true;
            }catch(Exception ex)
            {
                return false;
                //throw ex;  TODO: Write Log
            }
        }

        public static bool DeleteBook(int id)
        {
            try
            {
                var _book = MockBook.First(x => x.Id == id);
                MockBook.Remove(_book);
                return true;
            }
            catch(Exception ex)
            {
                return false;
                //throw ex;  TODO: Write Log
            }
        }


